text:
 Service Know-How Service the generator twice yearly. Even if you're not using the generator, it needs to be serviced. Select dates that fall outside possible severe weather such as heat spells, cold snaps, windy and stormy periods, etc. I generally tell customers to service their generators in the spring and fall times to keep it on a regular schedule (Rae Klepadlo). If you keep pushing off the maintenance, chances are your generator will not work when the time comes. An average service takes about an hour to complete, depending on what you find. Create a generator maintenance record book. Keep this updated with the dates of service and any issues found and fixed. Maintenance Checks Start by checking the overall condition of the generator. Look for corroded elements, loose wires, stuck buttons, etc. Check for any loose connections and frayed wiring. Make sure the area around the generator is clean, and if the generator has sucked in any dirt or leaves make sure to clean out the area. Debris getting into an alternator is the #1 way of destroying a perfectly good generator! Fix anything loose, stuck, or fraying. Seek professional advice if you're not sure what to do. It is best to be safe! Check the distilled water in the battery; top up if needed. Also check the battery's voltage. It is generally best to replace your battery every 2-3 years. Change the lubricant oil and filters (super, by-pass, etc.) following the manufacturer's instructions. This doesn't need to be done each 6 months; rather this is an annual task whether or not the generator has been operated. Record the yearly change in the record book so that you are reminded each time when it is due. Make sure that the oil level is adequate and top up if needed. Air cooled machines should have their oil replaced every 30-40 hours of run time. Liquid cooled machines should have their oil replaced every 100 hours of run time. MAKE SURE TO USE SYNTHETIC OIL IN AIR COOLED MACHINES! Clean the spark plugs. For the dollar fifty price tag of a spark plug, it is generally best to just replace the spark plugs annually. Check the bolts. Note that bolts on the generator will tend to loosen after reasonable usage; this is usual wear and tear caused by the vibrations. Check the gasket head and piston for solid condition; replace if worn or cracked. Check the fuel. Gasoline that is simply sitting in the generator loses its effectiveness after half a year when not used. You have several alternatives here:
Bleed the fuel and replace it; dispose of properly
Keep regularly used fuel for general farm/household use in fuel suitable containers and top up when needed
Add fuel stabilizer available from gas stations or hardware stores; follow manufacturer's instructions
If you are using a generator as a home standby solution, you should really consider a natural gas or liquid propane generator. These generators do not have any fuel maintenance, other than to make sure your LP tank has fuel in it! Check that the following items are properly calibrated annually or biannually, depending on usage patterns. It is best if a certified generator technician makes these checks:
